import React from 'react';
import { StatusBar } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createNativeStackNavigator } from '@react-navigation/native-stack';

import ListaCovid from './ListaCovid';
import Details from './Details';
import Login from './Login';
import ListaCondominios from './lista-condominio/ListaCondominios';

const Stack = createNativeStackNavigator();

export default function Navegacao() {
    return (
        <NavigationContainer>
            <Stack.Navigator>
                <Stack.Screen
                    name="Login"
                    component={Login}
                    options={{ title: "Login" }}
                />
                <Stack.Screen
                    name="ListaCovid"
                    component={ListaCovid}
                    options={{ title: "Lista Casos Covid-19" }}
                />
                <Stack.Screen
                    name="ListaCondominios"
                    component={ListaCondominios}
                    options={{ title: "Lista Condominios" }}
                />
                <Stack.Screen
                    name="Details"
                    component={Details}
                    options={({ route }) => ({ title: route.params.item.nome })}
                />
            </Stack.Navigator>
            <StatusBar barStyle="default" />
        </NavigationContainer>
    );
}

const styles = StyleSheet.create({
    itemContainer: {
        fontSize: 18,
        margin: 10,
        borderBottomWidth: 1,
        paddingBottom: 10
    },
    text: {
        fontFamily: 'Calibri',
        flexWrap: 'wrap',
        padding: 1
    },
    container:{
        backgroundColor: '#151A21'
    }
});
